import React from 'react';

function Header() {

    const headerStyle = {
        color: "white",
        backgroundColor: "Blue",
        padding: "10px",
        fontFamily: "Arial"
    };

    return (
        <div>

            <header style={headerStyle}>

                <h1> <i className="fa fa fa-clock-o text-white"></i> React Clock</h1>
            </header>
        </div>

    )
}

export default Header;
